import React from "react";
import { StyledBottomBar, StyledIcon } from "./styles";

export const BottomBar = () => {
  return (
    <StyledBottomBar>
      <StyledIcon></StyledIcon>
      <StyledIcon></StyledIcon>
      <StyledIcon></StyledIcon>
      <StyledIcon></StyledIcon>
    </StyledBottomBar>
  );
};
